(10010, 1511, 'biography', '<p>Nelson Mandela became the first black president of South Africa in 1994, serving until 1999. A symbol of global peacemaking, he won the Nobel Peace Prize in 1993. Was born on July 18, 1918, in Mvezo, Transkei, South Africa. Becoming actively involved in the anti-apartheid movement in his 20s, Mandela joined the African National Congress in 1942...</p>'),
