(22250, 2903, 'share_yor_thought_description', '<p>Feedback is at the heart and soul to ensure things are done right. Cultrahub is giving away $100 to the top 50 users that can provide us with the best feedback on why you feel this type of platform is needed, the impact it will have on society, what you will like to see from our website, and the value it will have on the community.</p>\r\n<p>This is your chance to shape our content and provide our users the most informative, User friendly, culturally enriching website of the 21st century.</p>'),
