(22264, 2904, '_form', '<ul class="ul row"><li class="col50"><label>First Name</label>[text* First-Name placeholder "Write your first name"]</li><li class="col50"><label>Last Name</label>[text* Last-Name placeholder "Write your last name"]</li><li class="col100"><label>Email Address</label><br />[email* Email-Address placeholder "Write your email address"]</li><li class="col100"><label>Feedback</label><br />[textarea* Feedback placeholder "Your feedback about the site"]</li><li class="col100"><label>Mood</label><div class="mood_list">[radio Mood class:cultra_mood use_label_element default:0 "Love it!" "Awesome!" "Like it!" "Don’t Like it!" "Boring!"]</div></li><li class="col100 align_center"><input type="submit" value="SUBMIT FEEDBACK" class="btnRed w80"><div class=""><small>You can also email us at <a href="mailto:info@cultrahub.com">info@cultrahub.com</a>.</small></div></li></ul>'),
